  false,\n\t\"url\": null,\n\t\"notes\": \"False Brome is quickly becoming a major
  threat to the southern end of the refuge with new populations found along hiking
  trails, spreading into wooded areas via wild game, and seeding into waterways. It
  is a threat to native prairie habitats containing listed species such as golden
  paintbrush, Kinkaidu2019s lupine and Fenderu2019s blue butterfly. Initial plans
  were to treat a small area but after investigating adjacent areas, it has become
  evident that more action will be needed to combat this invasive grass.Initial areas
  of infestation were surveyed and treated along with additional days spent spraying
  in areas plants have been found recently. A second round of treatment occurred in
  October with additional acres infested with false brome being found, mapped and
  treated. Areas treated include Pigeon Butte, Mill Hill and Woodpecker Loop.\",\n\t\"owner_org\":
